  {
    img: "../assets/img/dogos1.jpg",
    title: "Descubre el mejor lugar para tu mascota",
    subtitle: "solo en petheaven",
    btn1: "Nuestras habitaciones",
    btn2: "Agendar Habitacion",
  },
  {
    img: "../assets/img/dogos2.jpg",
    title: "Descubre el mejor lugar para tu mascota",
    subtitle: "solo en petheaven",
    btn1: "Nuestras habitaciones",
    btn2: "Agendar Habitacion",
  },
];
