    text: "Clientes",
    count: "300",
  },
];

export const services = [
  {
    icon: <i class="fa fa-hotel fa-2x text-primary"></i>,
    name: "Nuestras Habitaciones",
    discription: "Ofrecemos habitaciones cómodas y seguras para mascotas de todos los tamaños.",
  },
  {
    icon: <i class="fa fa-utensils fa-2x text-primary"></i>,
    name: "Alimento para nuestros peluditos",
    discription: "Nos aseguramos de que tu mascota reciba una dieta balanceada y nutritiva durante su estancia.",
  },
  {
    icon: <i class="fa fa-spa fa-2x text-primary"></i>,
