  },
  {
    icon: <i class="fa fa-glass-cheers fa-2x text-primary"></i>,
    name: "Diversion",
    discription: "Proporcionamos actividades recreativas para mantener a tu mascota entretenida y activa, ofreciéndole un entorno divertido y estimulante.",
  },

  {
    icon: <i class="fa fa-dumbbell fa-2x text-primary"></i>,
