    description:
      "PetHeaven ha sido un salvavidas para mí y mi perrito. Encontrar un lugar seguro para dejarlo mientras viajo nunca ha sido tan fácil. ¡Lo recomiendo 100%!",
    name: "Julian",
    icon: (
      <i class="fa fa-quote-right fa-3x text-primary position-absolute end-0 bottom-0 me-4 mb-n1"></i>
    ),
    img: "../assets/img/testimonial-3.jpg",
  },
];

export const roomItems = [
  {
    img: "../assets/img/pequena.jpg",
    price: "Q100/La noche",
    name: "Habitación Mascota Pequeña",

