    description:
      "Diseñada para mascotas grandes, esta bellahabitación es espaciosa, funcional y perfecta para ellos.",
    yellowbtn: "View Detail",
    darkbtn: "Agendar",
  },
];

export const facility = [
  {
    icon: <i class="fa fa-bed text-primary me-2"></i>,
    quantity: 1,
